INSERT INTO `mvs_functions` (`function_id`, `function_GUID`, `inputs`, `content`) VALUES
(21, 'media_mime', '["RawMedia"]', '$Media=$RawMedia;\n\nif (substr($RawMedia["mimetype"],0,4)=="text") $Media["content"]=htmlspecialchars($RawMedia["content"]);\n//stripslashes(htmlspecialchars($RawMedia["content"]));\nreturn $Media;'),
(22, 'post_media', '', '$GUID=$GLOBALS->_POST["GUID"];\n\nif ($GUID != "upload"){\n\n	$inputs=Array();\n	$posted_inputs=json_decode($GLOBALS->_POST["inputs"]);\n	foreach ($posted_inputs as $input) $inputs[$input]=Array();\n	\n	$data=Array(\n		"mimetype"=>$GLOBALS->_POST["mimetype"],\n		"content"=>$GLOBALS->_POST["content"],\n		"inputs"=>$inputs \n		);\n\n	if ($GUID=="new" || trim($GUID)==="" ) $GUID = null;\n\n}else{\n\n	$GUID = null;\n	$tmp_name=$GLOBALS->_FILES["filecontent"]["tmp_name"];\n	$mime_type=$GLOBALS->_FILES["filecontent"]["type"];\n	$file_content=file_get_contents($tmp_name);\n\n	$data=Array(\n		"mimetype"=>$mime_type,\n		"content"=>$file_content\n		);\n}\n\n$package=$GLOBALS->_POST["package_id"];\n$interface=$GLOBALS->_POST["interface_id"];\n\nif ( isset($GLOBALS->_POST[''new_package'']) && trim($GLOBALS->_POST[''new_package'']) != "") {\n	$create_package=Movabls::set_movabl("package",Array("meta"=>Array("label"=>$GLOBALS->_POST[''new_package''])) );\n	$package=$create_package;\n}\n\n\nif ( isset($GLOBALS->_POST[''new_interface'']) && trim($GLOBALS->_POST[''new_interface'']) != "") {\n	$create_interface=Movabls::set_movabl("interface",Array("meta"=>Array("label"=>$GLOBALS->_POST[''new_interface''])) );\n	$interface=$create_interface;\n	if ($package !="") Movabls::add_to_package($package,"interface", $interface);\n}\n\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]= Array ("label"=>$GLOBALS->_POST["label"]);\n\n$GUID=Movabls::set_movabl("media",$data, $GUID);\n\nif ($package !="") Movabls::add_to_package($package,"media", $GUID);\n\nif (isset($GLOBALS->_POST["place_url"])){\n  \n  $data=Array(\n    "url"=>utf8_encode($GLOBALS->_POST["place_url"]),\n    "media_GUID"=>$GUID,\n    "interface_GUID"=>$interface,\n    ''group_id''=>$GLOBALS->_POST["group_id"]\n  );\n\n  if (isset($GLOBALS->_POST["label"])) $data["meta"]["label"] = $GLOBALS->_POST["label"];\n  //$data["meta"]["parent"] = "root";\n  \n  $place_GUID=Movabls::set_movabl("place",$data);\n  \n  if ($package !="") Movabls::add_to_package($package,"place", $place_GUID);\n  \n  return date("h:i:s A");\n  \n}else{\n  Movabls::set_meta(array("updated"=>time()),''media'',$GUID);\n  return date("h:i:s A");\n}\n'),
(23, 'encode_inputs', '["Movabl"]', '$inputs = Array();\nforeach ($Movabl["inputs"] as $input=>$array) $inputs[]=$input;\n\nreturn json_encode($inputs);'),
(24, 'post_function', '', '$inputs=Array();\n\nif (isset($GLOBALS->_POST["inputs"]) ){\n$posted_inputs=json_decode($GLOBALS->_POST["inputs"]);\n\nforeach ($posted_inputs as $input)\n$inputs[$input]=Array();\n}\n$data=Array(\n"inputs"=>$inputs,\n"content"=>$GLOBALS->_POST["content"]\n);\n\n\n\n\n$package=$GLOBALS->_POST["package_id"];\n\nif ( isset($GLOBALS->_POST[''new_package'']) && trim($GLOBALS->_POST[''new_package'']) != "") {\n	$create_package=Movabls::set_movabl("package",Array("meta"=>Array("label"=>$GLOBALS->_POST[''new_package''])) );\n	//Movabls_Permissions::set_movabl_permissions("package",$create_package,array(array(''id''=>1,''read''=>1,''write''=>1,''execute''=>1)));\n	$package=$create_package;\n}\n\n\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]= Array ("label"=>$GLOBALS->_POST["label"]);\n\n//TODO fix this globally/delete this line and in post_interface\ndate_default_timezone_set(''America/New_York'');\n\nif ($GLOBALS->_POST["GUID"]!="new") $GUID=$GLOBALS->_POST["GUID"];\nelse $GUID = null;\n\n$GUID=Movabls::set_movabl("function",$data, $GLOBALS->_POST["GUID"]);\n//Movabls_Permissions::set_movabl_permissions("function",$GUID,array(array(''id''=>1,''read''=>1,''write''=>1,''execute''=>1)));\n\n	if ($package !="") Movabls::add_to_package($package,"function", $GUID);\n\n  Movabls::set_meta(array("updated"=>time()),''function'',$GUID);\n\nif ($GUID !="") return date("h:i:s A")." ".$GUID;\nelse return "error in set_function";\n'),
(47, 'post_interface', '', '//TODO make this an interface\n$json_content=json_decode($GLOBALS->_POST["json"],TRUE);\n\n$data=Array(\n"content"=>$json_content\n);\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]["label"] = $GLOBALS->_POST["label"];\n\n//TODO fix this globally/delete this line and in post_function\ndate_default_timezone_set(''America/New_York'');\n\n$GUID=Movabls::set_movabl("interface",$data, $GLOBALS->_POST["GUID"]);\n//Movabls_Permissions::set_movabl_permissions("interface",$GUID,array(array(''id''=>1,''read''=>1,''write''=>1,''execute''=>1)));\n\nif ($GUID !="") return date("h:i:s A")." ".$GUID;\nelse return "error in post_interface";\n'),
(48, 'mapinterface', '["Interface_Input"]', '    $tab = "  "; \n    $new_json = ""; \n    $indent_level = 0; \n    $in_string = false; \n\n    \n    $json = json_encode($Interface_Input["content"]); \n    $len = strlen($json); \n\n    for($c = 0; $c < $len; $c++) \n    { \n        $char = $json[$c]; \n        switch($char) \n        { \n            case ''{'': \n            case ''['': \n                if(!$in_string) \n                { \n                    $new_json .= $char . "\\n" . str_repeat($tab, $indent_level+1); \n                    $indent_level++; \n                } \n                else \n                { \n                    $new_json .= $char; \n                } \n                break; \n            case ''}'': \n            case '']'': \n                if(!$in_string) \n                { \n                    $indent_level--; \n                    $new_json .= "\\n" . str_repeat($tab, $indent_level) . $char; \n                } \n                else \n                { \n                    $new_json .= $char; \n                } \n                break; \n            case '','': \n                if(!$in_string) \n                { \n                    $new_json .= ",\\n" . str_repeat($tab, $indent_level); \n                } \n                else \n                { \n                    $new_json .= $char; \n                } \n                break; \n            case '':'': \n                if(!$in_string) \n                { \n                    $new_json .= ": "; \n                } \n                else \n                { \n                    $new_json .= $char; \n                } \n                break; \n            case ''"'': \n                if($c > 0 && $json[$c-1] != ''\\\\'') \n                { \n                    $in_string = !$in_string; \n                } \n            default: \n                $new_json .= $char; \n                break;                    \n        } \n    } \n\n    return $new_json;\n'),
(49, 'post_place', '', '//TODO - replace these globals with proper ints\n\n$data=Array(\n"url"=>utf8_encode($GLOBALS->_POST["place_url"]),\n"media_GUID"=>$GLOBALS->_POST["media_id"],\n"interface_GUID"=>$GLOBALS->_POST["interface_id"]\n);\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]["label"] = $GLOBALS->_POST["label"];\nif (isset($GLOBALS->_POST["parent"])) $data["meta"]["parent"] = $GLOBALS->_POST["parent"];\n\n\n$GUID=Movabls::set_movabl("place",$data);\n//Movabls_Permissions::set_movabl_permissions("place",$GUID,array(array(''id''=>1,''read''=>1,''write''=>1,''execute''=>1)));\n\nif ($GUID !="") return date("h:i:s A").$GUID;\nelse return "error in post_place";\n'),
(87, 'fnc000000014lyqqh8khw7l30vclu860', '', 'if( isset( $GLOBALS->_POST[''password''] ) && isset( $GLOBALS->_POST[''email''] ) ) {\n\n$create_user = Movabls_Users::create($GLOBALS->_POST[''password''], Array(''email''=>$GLOBALS->_POST[''email'']) );\n\n\nreturn $create_user;\n\n}else{\nreturn "FALSE";\n}'),
(88, 'fnc000000014lyqr1polu0a35j52dkp8', '', 'if (isset($GLOBALS->_POST[''name'']) && isset($GLOBALS->_POST[''password'']) ) {\n	if ( Movabls_Users::login(''name'', $GLOBALS->_POST[''name''] , $GLOBALS->_POST[''password''] ))\n	return "TRUE";\n	else \n	return "FALSE";\n}else{\nreturn "FALSE";\n}\n'),
(92, 'fnc000000014m06jtvjxs6oazcz8sc0i', '', '$result = Movabls_Data::data_query("\nSELECT DISTINCT mvs_packages.package_GUID, package_label.value as ''package_label'' FROM  mvs_packages \nINNER JOIN mvs_meta package_label ON mvs_packages.package_GUID = package_label.movabls_GUID AND package_label.movabls_type=''package'' AND package_label.key=''label''\nORDER BY package_label.value ASC;\n");\n\nwhile ($row = $result->fetch_assoc())\n  	$return[]=$row;\n  \n  \nreturn $return;'),
(93, 'fnc000000014m06juwo1wadqxwwlwvh3', '', 'return "users";'),
(94, 'fnc000000014m06k0b6t0b01tykdgrhg', '', 'return "groups";'),
(95, 'fnc000000014m1gofu0lae0xbfhfo799', '', 'if ($GLOBALS->_POST[''name'']!=""){\n\n$create_group = Movabls_Users::create_group($GLOBALS->_POST[''name''], $GLOBALS->_POST[''session_term''] );\n\n\nreturn $create_group;\n\n}else{\n\nreturn "FALSE";\n\n}'),
(96, 'fnc00000001glqzaqhhpzqshz7n7wxq', '', 'if ($GLOBALS->_POST[''name'']!=""){\n\n$create_package=Movabls::set_movabl("package",Array("meta"=>Array("label"=>$GLOBALS->_POST[''name''])) );\n\nMovabls_Permissions::set_movabl_permissions("package",$create_package,array(array(''id''=>1,''read''=>1,''write''=>1,''execute''=>1)));\n\nreturn $create_package;\n\n}else{\n\nreturn "FALSE";\n\n}'),
(123, 'fnc000000014qr5r3by025gev0uvtnmg', '', '//$packages=explode(",",$GLOBALS->_COOKIE["mvs_packages"]);\n\nif (isset($GLOBALS->_PLACE[''package'']) && !empty($GLOBALS->_PLACE[''package''])) $package_filter="AND mvs_packages.package_GUID=''{$GLOBALS->_PLACE[''package'']}''";\n$result = Movabls_Data::data_query("\nSELECT mvs_packages.movabls_GUID, place_label.value as ''place_label'', mvs_places.media_GUID, mvs_places.url, mvs_places.interface_GUID, media_label.value as ''media_label'' FROM  mvs_packages \nINNER JOIN mvs_places ON mvs_packages.movabls_GUID = mvs_places.place_GUID\nINNER JOIN mvs_meta place_label ON mvs_places.place_GUID = place_label.movabls_GUID AND place_label.movabls_type=''place'' AND place_label.key=''label''\nINNER JOIN mvs_meta media_label ON mvs_places.media_GUID = media_label.movabls_GUID AND media_label.movabls_type=''media'' AND media_label.key=''label''\nWHERE  mvs_packages.movabls_type =  ''place''\n$package_filter\nGROUP BY mvs_packages.movabls_GUID\nORDER BY mvs_places.url ASC;\n");\n\n\n\n\n\n/*$result = Movabls_Data::data_query("\nSELECT mvs_permissions.place_GUID, place_label.value as ''place_label'', mvs_places.media_GUID, mvs_places.url, mvs_places.interface_GUID, media_label.value as ''media_label'' FROM mvs_permissions\nINNER JOIN mvs_places ON mvs_permissions.place_GUID = mvs_places.place_GUID\nINNER JOIN mvs_meta place_label ON mvs_permissions.place_GUID = place_label.movabls_GUID AND place_label.movabls_type=''place'' AND place_label.key=''label''\nINNER JOIN mvs_meta media_label ON mvs_places.media_GUID = media_label.movabls_GUID AND media_label.movabls_type=''media'' AND media_label.key=''label''\nGROUP BY mvs_permissions.place_GUID\nORDER BY mvs_places.url ASC\n");*/\nwhile ($row = $result->fetch_assoc())\n  	$return[]=$row;\n  \n  \nreturn $return;'),
(124, 'fnc000000014qr6jfukoq4yml9khr79h', '', '$result = Movabls_Data::data_query("\nSELECT mvs_functions.function_GUID, function_label.value as function_label, LEFT(mvs_functions.content, 140) as ''function_sample'' FROM mvs_functions\nINNER JOIN mvs_meta function_label ON mvs_functions.function_GUID = function_label.movabls_GUID AND function_label.movabls_type=''function'' AND function_label.key=''label''\nGROUP BY mvs_functions.function_GUID\nORDER BY function_label.value ASC\n");\nwhile ($row = $result->fetch_assoc())\n  	$return[]=$row;\n  \n  \nreturn $return;');
